import React from "react";
import { Box } from "@mui/material";

const FlightLogs = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh", // This assumes you want to center it in the full viewport height. Adjust as needed.
      }}
    >
      <Box
        style={{
          borderTop: "1px solid #f59331",
          width: "80%",
          height: "100px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginBottom: "15px",
          position: "relative",
        }}
      >
        <Box
          style={{
            position: "absolute",
            top: "0",
            left: "50%",
            transform: "translate(-50%, -100%)",
            backgroundColor: "#181818",
            padding: "0 7px",
            zIndex: 1,
            fontSize: "25px",
          }}
        >
          Logs
        </Box>
      </Box>
    </div>
  );
};

export default FlightLogs;
